import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';
import App from './App';



export const render = () =>{
  return(
    ReactDOM.render(
      <BrowserRouter>
      <App/>
      </BrowserRouter>,
      document.getElementById('root')
    )
  )
}
